";}s:12:"mfn-post-css";a:1:{i:0;s:3793:"#Content {
  padding-top: 0;
}
td.text-right {
  text-align: right !important;
}
.selction-title {
  text-align: center;
  font-family: "Roboto Slab";
  font-size: 60px;
  font-weight: 700;
  color: #008b32;
}
.product-carousel ul.slick-dots {
  text-align: center;
}
.product-carousel ul.slick-dots li {
  width: auto;
}
.product-carousel ul.slick-dots button {
  font-size: 0;
  width: 60px;
  padding-top: 6px;
  padding-bottom: 6px;
  border: 2px solid #faca2b;
  background: 0 0;
  border-radius: 0;
  margin: 7px;
}
.product-carousel ul.slick-dots button:hover,
.product-carousel ul.slick-dots li.slick-active button {
  background: #faca2b;
}
.images-carousel a.slick-arrow,
.product-carousel a.slick-arrow {
  position: absolute;
  line-height: 0;
  margin-top: auto !important;
  margin-bottom: auto !important;
}
.images-carousel a.next-arrow,
.product-carousel a.next-arrow {
  right: -70px;
  top: calc(50% - 58px);
}
.images-carousel a.prev-arrow,
.product-carousel a.prev-arrow {
  left: -70px;
  top: calc(50% - 58px);
}
.images-carousel a.prev-arrow,
.product-carousel a.prev-arrow {
  left: -70px;
  top: calc(50% - 58px);
}
.product-carousel .product-item {
  height: max-content;
  border: 1px solid #dce0e6;
  background-color: #fff;
}
.product-carousel .product-item .product-image {
  width: 100%;
  height: 290px;
  background-size: 100% 100%;
  background-repeat: no-repeat;
  background-position: center;
  overflow: hidden;
}
.product-carousel .product-item .tem-chung-nhan {
  margin: 0 auto auto 0;
  padding: 5px;
}
.images-carousel .slick-slide,
.product-carousel .slick-slide {
  padding: 0 5px;
}
.product-carousel .product-name {
  padding: 5px 10px 0 10px;
  margin-bottom: 0;
  font-family: Roboto;
  font-size: 15px;
  color: #555;
  white-space: nowrap;
  overflow: hidden;
  text-overflow: ellipsis;
  max-width: 190px;
}
.product-carousel .product-price {
  padding: 0 10px 0 10px;
  font-family: Roboto;
  font-size: 20px;
  color: #109a2c;
  font-weight: 500;
  white-space: nowrap;
  overflow: hidden;
  text-overflow: ellipsis;
  max-width: 190px;
}
.product-carousel table,
.product-carousel table tr,
.product-carousel table tr td {
  border: none;
  box-shadow: none;
}
.product-carousel table tr td:first-child {
  text-align: left;
}
.product-carousel .adding-to-cart-btn {
  padding: 5px 8px;
  border-radius: 100%;
  background: #faca2b;
  color: #fff;
  font-size: 24px;
}
.product-carousel .adding-to-cart-btn:hover {
  background: #109a2c;
}
.product-carousel a {
  text-decoration: none;
}
.btn-min-width {
  min-width: 235px;
}
a.btn-min-width:hover {
  color: #fff !important;
}
@media screen and (min-width: 1024px) {
    .hidden-xl {
        display: none;
    }
}
@media screen and (max-width: 1024px) {
  .selction-title {
    font-size: 48px;
  }
  .slick-arrow {
    display: none !important;
  }
}
@media screen and (max-width: 600px) {
  .selction-title {
    font-size: 32px;
  }

  .product-carousel .product-item .product-image {
    height: calc((100vw - 20px) / 2);
  }

  .product-carousel table tr td {
      padding: 5px;
  }

  .product-carousel .product-name,
  .product-carousel .product-price {
      padding: 0;
  }

  .product-carousel .product-name {
      font-size: 14px;
  }

  .product-carousel .product-price { 
      font-size: 16px;
  }

  .hidden-sm {
      display: none;
  }
}
@media screen and (max-width: 480px) {
  .selction-title {
    font-size: 24px;
  }
}
.product-carousel .product-item:hover {
  box-shadow: 0px 6px 5px -3px #c1c1c1 !important;
}
.product-carousel .product-item:after {
  bottom: 0px !important;
}
